(9, '5f97b3af92a2f', 9, 'MutipleChoice', '<p>เลือกคำที่มีความหมายตรงกับคำศัพท์ที่กำหนดให้ cool</p>\r\n', 0, 0, 0, NULL, '2020-10-27 05:44:15', NULL, NULL),
(10, '5f97b3e04e2f6', 9, 'MutipleChoice', '<p>เลือกคำที่มีความหมายตรงกับคำศัพท์ที่กำหนดให้ silly</p>\r\n', 0, 0, 0, NULL, '2020-10-27 05:45:04', NULL, NULL),
(11, '5f9aa781a97d6', 3, 'MutipleChoice', '<p>บริษัทท่องเที่ยวทั่วทิศเช่าพื้นที่อาคารสำนักงานแห่งหนึ่ง 2 ชั้น โดยบริษัทมีพนักงานรวม 80 คน<br />\r\nพนักงานในแผนกต่างๆ ต้องมีการส่งข้อมูลและทำงานร่วมกัน<br />\r\nและบริษัทจำเป็นต้องติดต่อกับบริษัททะยานเวหาเมื่อต้องการหาเที่ยวบินผ่านระบบเครือข่าย<br />\r\nรูปแบบเครือข่ายของบริษัทควรเป็นแบบใด ลักษณะใด</p>\r\n', 0, 0, 5, NULL, '2020-10-29 11:29:05', NULL, NULL),
(12, '5f9aa9284f396', 8, 'MutipleChoice', '<p><strong>อินเทอร์เน็ต (Internet) เป็นเครือข่ายประเภทใด</strong></p>\r\n', 1, 0, 5, NULL, '2020-10-29 11:36:08', NULL, NULL),
(13, '5f9aa9623459d', 8, 'MutipleChoice', '<p><strong>ข้อใดเป็นพาณิชย์อิเล็กทรอนิกส์แบบ Pure e-commerce</strong></p>\r\n', 1, 0, 5, NULL, '2020-10-29 11:37:06', NULL, NULL),
(14, '5f9aa9dc04ef5', 8, 'MutipleChoice', '<p><strong>ธุรกิจร้านหนังสือซีเอ็ดบุ๊คเซ็นเตอร์ (SE-ED Book Center) ดำเนินธุรกิจรูปแบบใด</strong></p>\r\n', 1, 0, 5, NULL, '2020-10-29 11:39:08', NULL, NULL),
(15, '5fa11a28d185b', 7, 'MutipleChoice', '<p><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">ผู้บริหารบริษัทแห่งหนึ่งปฏิบัติตัวและใช้พลังงานไฟฟ้าลดน้อยลงเพื่อให้เข้ากับภาวะโลกร้อน เพื่อส่งเสริมนโยบายประหยัดพลังงานและแก้ปัญหาภาวะโลกร้อนของบริษัท จัดว่าผู้บริหารดังกล่าวมีลักษณะความสัมพันธ์กับผู้ใต้บังคับบัญชาตามข้อใด</span></span></p>\r\n', 1, 0, 5, NULL, '2020-11-03 08:51:52', NULL, NULL),
(16, '5fa11a4caade5', 7, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">โรงงานผลิตรองเท้าแห่งหนึ่งกำหนดว่า ในแต่ละวันคนงานในฝ่ายผลิตจะต้องผลิตรองเท้าให้ได้อย่างน้อย<br />\r\n5 คู่ และจะต้องผ่านการตรวจสอบคุณภาพทั้งหมด ข้อกำหนดดังกล่าวน่าที่จะจัดอยู่ในกระบวนการควบคุมในข้อใด</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 08:52:28', NULL, NULL),
(17, '5fa11a6e88849', 7, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">&ldquo;บริษัท ส่งถึงที่ จำกัด ทำธุรกิจ รับส่ง พัสดุ ภายในประเทศ รวมไปถึงจัดส่งไปในต่างประเทศ โดยมีสาขาอยู่ในจังหวัดใหญ่ๆ ไม่ว่าจะเป็น กรุงเทพฯ เชียงใหม่ หาดใหญ่ ขอนแก่น ชลบุรี ระยอง ทั้งนี้บริษัทยังคงขาดแคลนระบบการจัดการขนส่งให้ทันสมัย ทำให้ต้นทุนเมื่อเปรียบเทียบกับคู่แข่ง ยังคงสูงกว่า แต่อย่างไรก็ดี ด้วยว่าผู้ประกอบการและเจ้าหน้าที่ขายได้สร้างความสัมพันธ์ที่ดีกับลูกค้า ทำให้ลูกค้ายังคงใช้บริการจากบริษัทอยู่ แต่เนื่องจากความไม่มีเสถียรภาพทางการเมืองทำให้ธุรกิจที่เป็นลูกค้าลดการใช้บริการ อีกทั้งราคาน้ำมันที่เพิ่มสูงขึ้นทำให้ต้นทุนในการบริการการขนส่งสูงขึ้นตามลำดับ ทั้งนี้ผลจากภาวะเศรษฐกิจตกต่ำในช่วงปีที่ผ่านมาทำให้ผู้ประกอบธุรกิจรับส่ง พัสดุ รายอื่นต่างเลิกกิจการไปหลายราย&rdquo;ข้อใดต่อไปนี้ถือได้ว่าเป็น จุดแข็ง (</span></span><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">Strengths) ของ บริษัท ส่งถึงที่ จำกัด</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 08:53:02', NULL, NULL),
(18, '5fa11aa0e3240', 7, 'MutipleChoice', '<p><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">. &ldquo; บริษัท อุดร จำกัด เป็นผู้ผลิตและให้บริการในด้านการสื่อสารไร้สายในประเทศไทย ได้ประกาศข้อความดังต่อไปนี้ให้แก่ผู้ถือหุ้นสามัญ ดังนี้ว่า บริษัทจะทำการศึกษาวิจัย สร้างนวัตกรรมในด้านการสื่อสารในภูมิภาคเอเชีย เพื่อสร้างความสนใจให้แก่ลูกค้าทั้งกลุ่มเดิม และกลุ่มใหม่ โดยจะทำการผลิตคิดค้นโทรศัพท์ที่มีคุณลักษณะที่ตอบสนองต่อลูกค้า และสร้างยอดขายภายในประเทศและในภูมิภาคเอเชีย และใน 5 ปี นี้จะขยายส่วนแบ่งการตลาดเป็น 75 % เพื่อทำให้บริษัทเป็นผู้นำตลาด ในด้านการสื่อสารไร้สาย และโทรศัพท์มือถือ ของภูมิภาคเอเชีย&rdquo;ข้อใดต่อไปนี้ คือ พันธกิจของบริษัท</span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 08:53:52', NULL, NULL),
(19, '5fa11ad0de9f4', 7, 'MutipleChoice', '<p><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">หัวใจของการตลาดคือ</span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 08:54:40', NULL, NULL),
(20, '5fa11b021e09f', 7, 'MutipleChoice', '<p><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">เครื่องมือใดไม่เหมาะที่จะใช้ในการสร้างความจงรักภักดีในตราสินค้าให้กับลูกค้า</span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 08:55:30', NULL, NULL),
(21, '5fa11b2f66002', 7, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">ห้องชุดแมคโนเลียบริเวณแยกราชประสงค์เป็นโครงการคอนโดมิเนียมที่เจาะกลุ่มลูกค้ารายได้สูงที่ต้องการความสะดวกสบายและใช้ชีวิตย่านกลางเมือง สามารถจำหน่ายห้องชุดได้เกือบร้อยเปอร์เซ็นต์</span></span><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">&nbsp;จัดเป็นการดำเนินธุรกิจที่สอดคล้องกับแนวคิดทางการตลาดในข้อใด</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 08:56:15', NULL, NULL),
(22, '5fa11b5d03056', 7, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">ข้อใดกล่าวถูกต้องเกี่ยวกับสินค้าอุปโภคบริโภค (</span></span><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">Consumer Goods)</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 08:57:01', NULL, NULL),
(23, '5fa11b8c0fb30', 7, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">ข้อใดกล่าวไม่ถูกต้องเกี่ยวกับ สินค้าเปรียบเทียบซื้อ (</span></span><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">Shopping Goods)</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 08:57:48', NULL, NULL),
(24, '5fa11bbaa37a4', 1, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">ในวงจรชีวิตผลิตภัณฑ์ขั้นใดที่ธุรกิจอาจต้องทำการวิจัยและพัฒนาผลิตภัณฑ์ เพื่อเพิ่มความสามารถในการแข่งขันและ เพิ่มการเติบโตให้กับผลิตภัณฑ์</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 08:58:34', NULL, NULL),
(25, '5fa11bf843293', 1, 'MutipleChoice', '<p><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">โลจิสติกส์ต่างจากซัพพลายเชนอย่างไร</span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 08:59:36', NULL, NULL),
(26, '5fa11c3446bbd', 1, 'MutipleChoice', '<p><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">หากเปรียบเทียบการขนส่งเพื่อกระจายสินค้าตามช่องทางการจำหน่ายการขนส่งในข้อใดเหมาะสำหรับการขนส่งสินค้าที่มีนํ้าหนักมาก</span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 09:00:36', NULL, NULL),
(27, '5fa11c723fca8', 1, 'MutipleChoice', '<p><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">ข้อใดไม่จัดอยู่ในส่วนผสมการส่งเสริมการตลาด</span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 09:01:38', NULL, NULL),
(28, '5fa11c98390d8', 1, 'MutipleChoice', '<p><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">ผู้บริหารในข้อใดมีจริยธรรมทางการบริหารที่ไม่เหมาะสม</span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 09:02:16', NULL, NULL),
(29, '5fa11ccebe8d2', 1, 'MutipleChoice', '<p><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">คุณมานีให้ความสำคัญกับสิทธิประโยชน์ของพนักงานในบริษัท</span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 09:03:10', NULL, NULL),
(30, '5fa11d04470d0', 1, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">ข้อใดไม่ใช่ข้อมูลที่จะนำมาใช้วิเคราะห์อุปสรรคและโอกาสของธุรกิจ</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 09:04:04', NULL, NULL),
(31, '5fa11d2e6de5a', 1, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">แนวโน้มของการใช้ชีวิตของคนในปัจจุบันที่หันมาให้ความสำคัญกับการดูแลสุขภาพ จัดอยู่ในส่วนใดของ </span></span><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">SWOT ของธุรกิจผลิตสินค้าออร์แกนิค</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 09:04:46', NULL, NULL),
(32, '5fa11d55e5a74', 1, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">. ข้อใดไม่ใช่ค่าใช้จ่ายในการเก็บรักษาสินค้า (</span></span><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">Holding Cost)</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 09:05:25', NULL, NULL),
