(89, '5fa12f4463216', 10, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><em><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">&ldquo; ย้อนกลับไปในปี 2018 มาร์ค ซัคเคอร์เบิร์ก ซีอีโอของ </span></span></em><em><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">Facebook ต้องขึ้นให้การกับสภาครองเกรสของสหรัฐฯ เรื่องข่าวลือว่าทำข้อมูลของผู้ใช้ 87 ล้านคนรั่วไหล จนส่งผลให้หุ้นของเฟซบุ๊กร่วงระนาว ข่าวลือดังกล่าวเป็นจริง ข้อมูลผู้ใช้ 87 ล้านคนรั่วไหลไปเข้าสู่มือของบริษัทเอกชนรายหนึ่งที่ชื่อเคมบริดจ์ อะนาไลติก้า (Cambridge Analytica) ซึ่งเคมบริดจ์อะนาไลติก้า ได้นำข้อมูลนั้นมาใช้ประโยชน์ด้วยการช่วยในแคมเปญหาเสียงของ โดนัลด์ ทรัมป์ จากพรรครีพับบลิกัน ในปี 2016 จนพาทรัมป์พลิกสถานการณ์ แซงเอาชนะฮิลลารี่ คลินตัน ตัวเต็งจากเดโมแครต ไปได้แบบสุดเซอร์ไพรส์ &rdquo;</span></span></em></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">จากเรื่องดังกล่าว</span></span><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\"> Facebook ละเมิดสิทธิ์ของผู้ใช้ระบบในข้อใด</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 10:21:56', NULL, NULL),
