(91, '5fa12f6b2a5ee', 10, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">จากเรื่องดังกล่าว วิธีใดช่วยลดการละเมิดสิทธิ์ของผู้ใช้จาก </span></span><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">Facebook Application ได้ดีที่สุด</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 10:22:35', NULL, NULL),
(92, '5fa12f89629cd', 10, 'MutipleChoice', '<p style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">ผู้ใช้ </span></span><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">Facebook ต้องยึดหลักจริยธรรมของสังคมต่อไปนี้ <u>ยกเว้น</u>ข้อใด</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 10:23:05', NULL, NULL),
(93, '5fa12fa814369', 10, 'MutipleChoice', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;Angsana New&quot;,serif\">ข้อใด<u>ไม่ใช่</u> มาตรการป้องกันความปลอดภัยของระบบคอมพิวเตอร์</span></span></span></span></p>\r\n', 0, 0, 5, NULL, '2020-11-03 10:23:36', NULL, NULL),
