(95, '608bd1c59509a', 17, 'MutipleChoice', '<p>คำว่า Entrepreneur มีที่มาจากภาษาฝรั่งเศสซึ่งความหมายว่า</p>\n', 0, 0, 3, NULL, '2021-04-30 09:45:41', NULL, NULL),
(96, '608bd1fe03fde', 17, 'MutipleChoice', '<p>สิ่งที่สำคัญและเป็นแนวคิดของการประกอบการ คือข้อใด</p>\n', 0, 0, 3, NULL, '2021-04-30 09:46:38', NULL, NULL),
(97, '608bd2005d70e', 17, 'MutipleChoice', '<p>ทำไมการประกอบการถึงเป็นกลไกสำคัญของการขับเคลื่อนเศรษฐกิจและสังคม</p>\r\n', 0, 0, 3, NULL, '2021-04-30 09:46:40', NULL, NULL),
(98, '608bd22b9a323', 17, 'MutipleChoice', '<p>การประกอบการและการทำธุรกิจเหมือนกันไม่</p>\n', 0, 0, 3, NULL, '2021-04-30 09:47:23', NULL, NULL),
