(200, '5fa125af348a9', '<p><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">บริษัทปตท ออกหุ้นกู้จำหน่ายให้กับนักลงทุนระยะเวลาไถ่ถอน 10 ปี</span></span></p>\r\n', '1.0000000'),
(201, '5fa125af348a9', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">บริษัทการบินไทยทำสัญญาเช่าคอมพิวเตอร์จากบริษัทเอเซอร์ คอมพิวเตอร์ ประเทศไทยจำกัด</span></span></span></span></p>\r\n', '0.0000000'),
(202, '5fa125af348a9', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">มหาวิทยาลัยหอการค้าไทยทำสัญญาเช่าซื้อเครื่องมัลติฟังชั่น เพื่อใช้ในงานพิมพ์ ถ่ายเอกสารแสกนภาพ และ ส่งแฟกซ์ จากบริษัทฟูจิ ซีร็อกซ์ ประเทศไทย จำกัด</span></span></span></span></p>\r\n', '0.0000000'),
(203, '5fa125d6390f0', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">มูลค่าเงินในปัจจุบันมีมูลค่าเท่ากับมูลค่าเงินในอนาคต</span></span></span></span></p>\r\n', '0.0000000'),
(204, '5fa125d6390f0', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">มูลค่าเงินหมายถึงมูลค่าที่ตราไว้ตามธนบัตร เช่น 100 บาท</span></span></span></span></p>\r\n', '0.0000000'),
(205, '5fa125d6390f0', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">มูลค่าเงินในปัจจุบันมักจะมีมูลค่าสูงกว่าในอนาคต เนื่องจากเราสามารถนำเงินในปัจจุบันไปลงทุนให้เกิดผลตอบแทนในอนาคต</span></span></span></span></p>\r\n', '1.0000000'),
(206, '5fa125d6390f0', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">มูลค่าเงินในปัจจุบันมักจะมีมูลค่าสูงกว่ามูลค่าเงินในอนาคต เนื่องจากอัตราเงินเฟ้อ</span></span></span></span></p>\r\n', '0.0000000'),
(207, '5fa1281b38be5', '<p><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">AEC คือการรวมกลุ่มทางเศรษฐกิจของประเทศในอาเซียน เช่นเดียวกับกลุ่มสหภาพยุโรป EU แต่อาจจะไม่รวมกลุ่มใช้เงินสกุลเดียวกันเหมือนเช่นกลุ่มสหภาพยุโรป</span></span></p>\r\n', '1.0000000'),
(208, '5fa1281b38be5', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">เมื่อค่าเงินบาทแข็งค่าขึ้นเมื่อเทียบกับประเทศคู่แข่ง จะทำให้เศรษฐกิจไทยดีขึ้น เนื่องจากเราจะสามารถส่งออกสินค้าขายในต่างประเทศได้มากขึ้น</span></span></span></span></p>\r\n', '0.0000000'),
(209, '5fa1281b38be5', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">ระบบอัตราแลกเปลี่ยนไทยปัจจุบันใช้แบบอัตราแลกเปลี่ยนแบบคงที่ ทำให้ค่าเงินไม่เปลี่ยนแปลงมาก ผู้ส่งออกและนำเข้าไม่จำเป็นต้องใส่ใจเรื่องค่าเงินบาท</span></span></span></span></p>\r\n', '0.0000000'),
(210, '5fa1281b38be5', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\"><span style=\"font-family:&quot;Cordia New&quot;,sans-serif\"><span style=\"font-size:16.0pt\"><span style=\"font-family:&quot;TH SarabunPSK&quot;,sans-serif\">ถ้าเราต้องเดินทางไปประเทศเกาหลี เราสามารถนำเงินบาทเพื่อไปแลกเปลี่ยนเป็นเงินดอง ตามะธนาคารทั่วไปที่ประเทศเกาหลีได้เลย</span></span></span></span></p>\r\n', '0.0000000');
