(402, '608bd2f99b33a', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-size:10.0pt\"><span style=\"font-family:Sarabun\">ทำแต่สิ่งที่ชอบเพื่อจะได้ทำได้ดี</span></span></span></span></p>\n', '0.0000000'),
(403, '608bd2fb0b7f7', '<p>ลูกค้า/ การสร้างคุณค่า/ การกระจายสินค้าและบริการ/ การให้บริการหลังการขาย</p>\r\n', '0.0000000'),
