(410, '608bd3458d97a', '<p>เพื่อหาว่าใครคือคนแรกที่จะเข้าไปเก็บข้อมูลและทดสอบสำหรับสิ่งที่บริษัทกำลังจะทำ</p>\r\n', '0.0000000'),
